import Attribution from './components/Attribution';
import Calculator from './components/Calculator';
import Result from './components/Result';

function App() {
  return (
    <main>
      <header>
        <div class="logo"><img src="./images/logo.svg" alt="" /></div>
      </header>
      <Calculator />
      <Result />
      <Attribution />
    </main>
  );
}

export default App;
